(12, 'Vetwest Clarkson', 'Vetwest Clarkson is located at 3/70 Penascola Terrace, conveniently off of Marmion Ave, near the Cheesecake Shop. It is accessible between Ocean Keys Blvd and Neerabup Road. There is ample parking for you and your pet to easily arrive at your appointment. We provide high quality veterinary care for the suburbs of Clarkson, Mindarie, Merriwa, Kinross, and Burns Beach.\n\nVetwest Animal Hospitals have been providing veterinary care to the pets of Perth for over 20 years, with more than a dozen clinics in both the Northern and Southern suburbs. We pride ourselves on working to the highest standards of veterinary medicine, keeping up to date with the latest advancements. Our team of compassionate veterinarians attend seminars and conferences to keep up to date with the latest in veterinary knowledge. Our vet nurses are here to provide you with the best experience possible, ensuring your pets well-being and comfort at all times.\n\nVetwest Clarkson has been awarded the ASAVA Accreditation of Excellence. This honour is reserved for veterinary clinics that achieve the highest levels of quality health care and practice management in innovative, state-of-the-art hospital facilities. This means that you can be sure you are getting only the highest care for your pet. Open 7 days a week and staffed by a team of passionate veterinarians and caring nurses, Vetwest Clarkson offers an unsurpassed quality of care for your pets in modern facilities. Contact Vetwest Clarkson today for your next appointment', 'null', 'marketing@vetwest.com.au', '08 9404 1151', '08 9404 1111', 'Clarkson', '3/70 Pensacola Terrace', '6030', 'WA', 36, '-31.690931', '115.715924', NULL, 'https://www.vetwest.com.au/about/locations/clarkson/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/vetwest\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00