(14, 'Vetwest Canning Vale', 'Vetwest Animal Hospital Canning Vale is located at 5/888 Nicholson Road, on the corner of Nicholson Road and Ranford Road, adjacent to Dan Murphy?s. There is ample free parking on site so you will be able to easily pop into the clinic with your pet for your appointment. We are proud to provide veterinary care for the areas of Canning Vale, Southern River, Jandakot, Harrisdale, Bull Creek, Willeton and other surrounding areas.\n\nVetwest Animals Hospitals has been treating and caring for the pets in Perth for over 25 years. We strive to provide the best service for you and highest standards of care for your pet. \n\nVetwest Canning Vale has multiple consult rooms, a dedicated surgery theatre, a dog wash, and kennels for both small and large pets. Our waiting room has a separate area for cats which can help alleviate any stress they may feel before their appointment. Be sure to contact Vetwest Canning Vale for your next appointment, we\'re here when you need us.', 'null', 'marketing@vetwest.com.au', '08 9404 1162', '08 9404 1111', 'Canning Vale', '5/888 Nicholson Road', '6155', 'WA', 36, '-32.090073', '115.918398', NULL, 'https://www.vetwest.com.au/about/locations/canning-vale/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/vetwest\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:30\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:30\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:30\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"17:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"08:00\",\"sunday-to\":\"17:00\",\"sunday-from