(15, 'Vetwest Bibra Lake', 'Vetwest Animal Hospital Bibra Lake is located at 19 Port Kembla Drive, on the corner of Port Kembla Drive and Malabar Way. The clinic is conveniently accessed from both Phoenix Road and Spearwood Ave, just off Stock Road. There is ample on-site parking for you and your pet. We are proud to provide veterinary care to the areas of Bibra Lake, Spearwood, Coolbellup, South Lake, Yangebup and other surrounding areas.\n\nVetwest Animal Hospitals has been providing veterinary care for thousands of happy pet families in Perth for over 25 years. With a team of passionate veterinary professionals throughout all our clinics, we offer the highest quality of care for our patients. Clients of the former Pet Doctor Hospital in Bibra Lake will find their pet?s health records have been integrated into the Vetwest Animal Hospitals patient records. Your pet\'s details can be accessed at all Vetwest clinics, should you ever need to visit any of our hospitals around Perth. Want to see us on a Sunday? Vetwest Cockburn is only a 10-minute drive. \n\nVetwest Bibra Lake has a large open waiting room so you and your pet can relax with ample space before appointments. We regularly have rescue kittens and cats available for adoption at Vetwest Bibra Lake that are looking for their forever homes. Our qualified veterinary nurses provide expert care for your pet, from dog washing to nail clips and over the phone advice should you have any questions. Call the clinic today for your next appointment for your pet.', 'null', 'marketing@vetwest.com.au', '08 9404 1188', '08 9404 1111', 'Bibra Lake ', '19 Port Kembla Drive', '6163', 'WA', 36, '-32.097207', '115.801283', NULL, 'https://www.vetwest.com.au/about/locations/bibra-lake/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/vetwest\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",