(16, 'Vetwest Ballajura', 'Vetwest Animal Hospital Ballajura is located at 110 Illawarra Crescent, at the corner of Illawarra Drive and Marangaroo Drive, visible from the roundabout. There is parking available directly out the front of the clinic. We proudly offer vet care to the areas of Ballajura, Alexander Heights, Koondoola, Mirrabooka, Malaga and other surrounding suburbs.\n\nVetwest Animal Hospitals has been caring for the pets of Perth for 25 years, with clinics all around the Perth metro area. Our passionate team of veterinarians and vet nurses strive to provide you with the highest standards in veterinary care. Former patients of Ballajura Veterinary Hospital will find that their health records have been transferred to Vetwest Ballujura. For your convenience, your pet?s records are available at all Vetwest clinics, so you will receive continuity of care at all of our locations.\n\nVetwest Ballajura is open 7 days a week with extended trading hours till 7pm on weekdays and 5pm on weekends. The clinic is regularly staffed by multiple vets each day, so you have plenty of opportunity to find an appointment time that suits you and your pet. We see consultations by appointment in order to minimise your waiting time and reduce stress for your pet. Vetwest Ballajura has all your pets healthcare needs covered and our fully qualified veterinarians offer services including general health checks, vaccinations, sterilisations, dental procedures, complex surgeries and much more. We offer free nail clips and free dental checks with our registered vet nurses to help make caring for your pet more affordable=', 'null', 'marketing@vetwest.com.au', '08 9404 1150', '08 9404 1111', 'Ballajura', '110 Illawarra Crescent', '6066', 'WA', 36, '-31.833679', '115.885691', NULL, 'https://www.vetwest.com.au/about/locations/ballajura', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/vetwest\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:30\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:30\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:30\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"17:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"08:00\",\"sunday-to\":\"17:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(17, 'Vetwest Armadale-Byford', 'Vetwest Armadale ? Byford is located at 370 South Western Highway, Wungong WA 6112, in the South-East of Perth?s metropolitan area. We are located between Moore St and Mitchell St and conveniently located only 3.2 km south of Armadale Shopping Centre, 3.4km south of Armadale Train station and 5.1 km north of Byford train station. The City of Armadale has a thriving community spirit that Vetwest is proud to be a part of, not just in our own suburb of Wungong (located midway between Armadale and Byford) but also in the surrounding areas. We are proud to service the entire foothills area in the South-East of Perth including the local suburbs of Armadale, Byford, Wungong, Kelmscott, Mount Richon and beyond. Wungong, a name said to be of Australian Aboriginal descent is thought to mean ?embracing? in local Nyungar language. At Vetwest Armadale-Byford, we think this name is a perfect fit for our location! \n\nOur hospital on South Western Highway can be easily spotted by the big blue Vetwest sign and banners on the roadside - you can?t miss us! You\'ll often see us promoting our popular free services such as free nail clipping, free dental checks or our special promotions that we run to help make caring for your pet more affordable. There is ample parking available and our beautiful gardens offer plenty of room for your dog to have a sniff and go to the toilet before and after their visit. We know you and your beloved pets will be comfortable from the minute you arrive at Vetwest Armadale-Byford.', 'null', 'marketing@vetwest.com.au', '08 9404 1170', '08 9404 1111', 'Wungong', '370 South Western Highway', '6112', 'WA', 36, '-32.181894', '116.015573', NULL, 'https://www.vetwest.com.au/about/locations/armadale-byford/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/vetwest\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:30\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:30\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:30\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"17:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(18, 'Veterinary Happiness', 'Veterinary Happiness was established in 1998 by Dr Deborah Webb, with a vision to provide the highest standards of care both professionally and personally to the pets in our care, in a warm and welcoming environment. Everyone at Veterinary Happiness has an absolute love and compassion for dogs, cats and other furry and feathered critters.\n\nThe Clinic is located at 3 Marine St, Redland Bay opposite the shopping precinct and offers a clean, comfortable and welcoming environment for you and your pets, with ample parking, a kiddie?s corner and free Wi-Fi in reception.', 'null', 'info@vethappiness.com.au', '07 3206 7911', '07 3206 7911', 'Redland Bay', '3 Marine St', '4165', 'QLD', 36, '-27.610711', '153.302035', NULL, 'http://www.vethappiness.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/VetHappiness\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"18:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"18:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"18:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"18:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"18:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(19, 'Veterinary Associates Takanini', 'Veterinary Associates is about ?Quality, Affordable Care?.\n\nWe are a modern progressive multivet practice. Experience is something money cannot buy. Our vets have over 50 years combined experience. We have a wide range of skills.  Dr Andrew Bootle graduated with distinction. Dr Christie McDonald recently completed an advanced internal medicine course through the University of Sydney and Dr Eckhard Stalmann recently joined us after completing a surgical residency at Veterinary  Specialist Group  in Auckland, bringing with him all the latest knowledge and skills.\n\nVeterinary Associates? hospital in Auckland is one of Australasia?s most modern veterinary hospitals. It is dedicated exclusively to the care and treatment of dogs, cats and other small animals. We have all the latest gadgetry.  We have a commitment to continuing education. We regularly attend congresses and education seminars. Dr McDonald is studying towards membership of the Australian and New Zealand Veterinary College. Her special area of interest is small animal medicine which involves the diagnosis and treatment of complicated disease conditions. Our vets are members of the New Zealand Veterinary Association and the Companion Animal Society.  Our vets, nurses and support staff regularly attend congresses & conferences. This commitment to continually upgrade our knowledge and equipment ensures that our patients are treated in a manner they deserve and in a manner you, as a discerning pet owner, have come to expect.\n\nRecent upgrades at the hospital include digital x rays, new monitoring equipment, an electrosurgical unit, the addition of new surgical instrumentation, new ultrasonic cleaners and lot of other equipment. We are one of a few hospitals able to perform the latest ostoeotmy procedures for cruciate injuries. We have recently started doing a TTA (Tibial Tuberosity Advancement) procedure for cruciate injuries.', 'null', 'vets@netvet.co.nz', '(09) 299-8