(25, 'Total Vets', 'Our mission is to provide exceptional veterinary surgical and medical care using modern equipment and knowledgeable, engaging staff. This allows us to provide quality and professional veterinary medicine and surgery for your pet in a warm and friendly environment.\n\nEach of our veterinarians practices medicine and surgery, providing both routine and advanced care expected from a leading veterinary clinic. Our veterinarians offer individual wellness and geriatric vaccination protocols with an approach tailored to each patient\'s unique history, including age, lifestyle, and location. While each patient may have a primary veterinarian, we operate as a team to provide comprehensive and in-depth medical care.', 'null', 'info@totalvets.co.nz', '03 389 45 64', 'null', 'Christchurch', '516 Gloucester St', '8011', 'NZ', 554, '-43.53014', '172.6624', NULL, 'https://www.totalvets.co.nz/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/TotalVets\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:30\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:30\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:30\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:30\",\"saturday-to\":\"14:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"09:30\",\"sunday-to\":\"14:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26, 'Sylvania Veterinary Hosital', 'At Sylvania Veterinary Hospital  we care for your pets. We want to make you and your pet feel at ease in our hospital with a caring and gentle approach to treatment and consultations.Our dedicated staff are all passionate about pets.\n\nSylvania Veterinary Hospital has extended opening hours. We are open Monday to Friday 7am - 11pm, Saturday & Sunday 7am - 8pm and on Public Holidays, from 8am - 5pm, providing you and your pets with greater access to specialist veterinary care. ', 'null', 'mail@sylvaniavet.com.au', '02 9522 7088', '02 9522 7088', 'Sylvania', ' 335 Princes Highway ', '2224', 'NSW', 36, '-34.017144', '151.091741', NULL, 'http://www.sylvaniavet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/Sylvania-Veterinary-Hospital-149312131767251\\/\"}', '{\"monday-from\":\"07:00\",\"monday-to\":\"23:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:00\",\"tuesday-to\":\"23:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:00\",\"wednesday-to\":\"11:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:00\",\"thursday-to\":\"23:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:00\",\"friday-to\":\"23:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"07:00\",\"saturday-to\":\"20:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"07:30\",\"sunday-to\":\"20:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27, 'Sydney University Veterinary Teaching Hospital', 'The Sydney University Veterinary Teaching Hospital is acclaimed internationally for its exceptional health, care and welfare of animals. It is a general practice veterinary clinic, a referral centre for other vets to send complex cases and a teaching hospital for veterinary science students to learn the practical components of the veterinary profession.\nThe Hospital has undergone substantial redevelopment including the purchase of more than $6 million of imaging and diagnostic equipment making it an international state-of-the-art facility.', 'null', 'univet@sydney.edu.au  ', '(02) 9351 3437', '9351 3437', 'Camperdown', '65 Parramatta Rd', '2050', 'NSW', 36, '-33.886541', '151.181144', NULL, 'http://www.uvths.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/UVTHS\\/\"}', '{\"monday-from\":\"00:00\",\"monday-to\":\"00:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"00:00\",\"tuesday-to\":\"00:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"00:00\",\"wednesday-to\":\"00:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"00:00\",\"thursday-to\":\"00:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"00:00\",\"friday-to\":\"00:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"00:00\",\"saturday-to\":\"00:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"00:00\",\"sunday-to\":\"00:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
