(30, 'Salisbury Park Veterinary Hospital', 'Vets4Pets was founded in 1972 and has grown to provide a wide range of small animal veterinary care in Adelaide, through its seven convenient locations in Adelaide\'s Northern suburbs including the new Vets4Pets Dernancourt Veterinary Centre.\n\nLarge Practice Resources Combined with Personal Veterinary Care.\n\nEvery Vets4Pets local practice offers professional facilities, modern equipment and highly trained people who love animals. We believe in offering the very best in general veterinary care.\n\nA senior vet will oversee the case management and treatment of your pet for as long as you remain our client. Should your pet need a specific service (such as ultrasound, orthopaedic surgery etc), special equipment or even hospitalisation, your case manager draws upon the extensive skills and facilities of the Vets4Pets Group.', 'null', 'admin@vets4pets.com.au', '(08) 8258 0168', '08 8289 3722', 'Salisbury Park', '1914 Main North Road', '5109', 'SA', 36, '-34.758794', '138.675382', NULL, 'http://www.vets4pets.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/vets4petssa\\/\"}', '{\"monday-from\":\"09:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"09:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"09:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"09:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"09:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31, 'VetCare', 'Our dedicated team of caring vets and nurses who will be taking great care of your precious pets. We emphasise a holistic approach, and promote sound preventative health measures to improve both your pet?s longevity and quality of life.', 'null', 'unitec@vetcare.net.nz', '(09) 361 3500', 'null', 'Grey Lynn, Auckland', '408 Great North Road', '1021', 'NZ', 554, '-36.866498', '174.741741', NULL, 'http://vetcare.net.nz/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/VetCare\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"18:30\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"18:30\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"18:30\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"18:30\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"18:30\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"13:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32, 'Thornleigh Veterinary Hosital', 'At Thornleigh Veterinary Hospital, we aim to  provide compassionate community-based expert care to your beloved pets. With fully equipped examination rooms, updated diagnostic equipment and pharmaceutical stores we provide on-the-spot assistance for nearly all pet health and medical needs. Our knowledgeable, experienced veterinarians will ensure you receive expert, honest advice to keep your pet healthy and happy for many years to come.  After all, they are part of the family!\nWe have two full times vets who have an abundance of local knowledge and experience and a team of dedicated nurses that will endeavour to make your pets feel at ease and work tirelessly to ensure our hospital is running smoothly.', 'null', 'mail@thornleighvet.com.au', '02 9484 7418', '02 9484 7418 ', 'Thornleigh', '180 Pennant Hills Road ', '2120', 'NSW', 36, '-33.724334', '151.086153', NULL, 'http://www.thornleighvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/thornleighvet\\/\"}', '{\"monday-from\":\"08:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:30\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:30\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:30\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"13:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"09:00\",\"sunday-to\":\"12:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(33, 'South Eastern Animal Hospital', 'Your pet is in experienced hands. We go to great lengths to make sure your pet is healthy, happy and lives a long life.\n\nThis formula has carried us through over 20 years in business and we believe it is what will keep us creating more happy and healthy pets.\n\nOriginally called the Clayton Veterinary Hospital, South Eastern was established by Dr. Bob Southern in 1972. In Oct 2008, after 7yrs of planning, development and building, the current facility was finished and the business was rebranded as the South Eastern Animal Hospital.\n\nSouth Eastern Animal Hospital is centrally located in Clayton, on the corner of Burton Ave and Centre Rd (between Warrigal Rd and Clayton Rd).\n\nOff-street parking is available in Burton Ave.', 'null', 'info@southeasternvet.com.au', '03 9544 6979', '(03) 9544 6979', 'Clayton', '1357 Centre Road', '3168', 'VIC', 36, '-37.927816', '145.114309', NULL, 'https://www.southeasternvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/southeasternvet\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"19:30\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"19:30\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:30\",\"wednesday-to\":\"19:30\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:30\",\"thursday-to\":\"19:30\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:30\",\"friday-to\":\"19:30\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"15:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
