(35, 'Shepparton Veterinary Clinic', 'Our two locations have fully equipped examination rooms, large pharmaceutical stores, full sterile surgery facilities and a full range of modern equipment for on-the-spot assistance for nearly all pet health and medical needs. We can offer digital X-rays, on site ECG and ultrasound examinations, Dental care using the latest IM-3 dental base and on the spot, in house blood testing. We have a number of visiting specialists and consultants and good relationships with a number of Melbournes leading specialist centres for when referral is necessary.', 'null', 'info@sheppvets.com.au', '(03) 5821 3188', 'null', 'Shepparton North', '2 Wanganui Rd', '3631', 'VIC', 36, '-36.34706', '145.401199', NULL, 'http://sheppvets.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/sheppvets\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"18:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"18:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"18:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"18:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"18:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"16:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"10:00\",\"sunday-to\":\"14:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(36, 'Salisbury Vet Surgery', 'Salisbury Vet started in 1983 at 216 Lillian Ave. Dr John started working here in Dec 1995, and he purchased the clinic when the previous boss retired in 1999. We started to grow, so we relocated to bigger premises at 220 Lillian Ave in 2005.\n \nWe keep growing, so in 2016, we relocated again. This time we moved to Unit 1, 668 Toohey Road, Salisbury (Behind McDonalds, and next the The Salisbury Hotel), at the junction of Toohey Rd, Evans Rd and Orange Grove Rd, Salisbury, Qld.\n \nThis move was necessary due to the increasing client demand for our excellent professional services and reasonable pricing. The current place is more than twice the size of the previous Lillian Ave clinic.', 'null', 'info@salisburyvet.com.au', '(07) 3277 8620', '07 3172 0593', 'Salisbury', 'Unit 1/668 Toohey Rd', '4107', 'QLD', 36, '-27.545464', '153.039946', NULL, 'http://www.salisburyvet.net.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/salisburyvetsurgery\\/\"}', '{\"monday-from\":\"08:30\",\"monday-to\":\"18:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:30\",\"tuesday-to\":\"18:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:30\",\"wednesday-to\":\"18:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:30\",\"thursday-to\":\"18:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:30\",\"friday-to\":\"18:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:30\",\"saturday-to\":\"12:30\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(37, 'Ryde Veterinary Clinic', 'Ryde Veterinary Clinic has a caring and dedicated team that treat your pets like family. The clinic is fully equipped and offers health checks, surgery, radiology, vaccinations, pet supplies and can also arrange for your pet to be boarded.\nThe clinic is in central Ryde and has parking out the front on Quarry Rd. It is local to North Ryde, Eastwood and Marsfield. They are open 7 days a week', 'null', 'info@rydevet.com.au', '(02) 9809 4788', '02 9436 1213', 'Ryde', '130 Quarry Rd', '2112', 'NSW', 36, '-33.804942', '151.114502', NULL, 'http://www.vetfriends.com.au/veterinary-hospital-ryde', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/Ryde.Veterinary.Clinic\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:30\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:30\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:30\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"14:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"09:00\",\"sunday-to\":\"12:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(38, 'Riverview Animal Hospital', 'Riverview Animal Hospital services the areas of Lane Cove, Longueville, Greenwich and surrounding suburbs of Lower North Shore Sydney. We offer a high standard of care for your cat or dog, and additional services like cat boarding and dog grooming.', 'null', 'info@riverviewvet.com.au', '(02) 9428 3375', 'null', 'Lane Cove', '18 Northwood Rd', '2066', 'NSW', 36, '-33.824076', '151.172644', NULL, 'https://riverviewvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/Riverview-Animal-Hospital-157818794425059\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"15:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"10:00\",\"sunday-to\":\"12:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(39, 'Riverbank Animal Hospital', 'Riverbank Animal Hospital vets service the Grafton area. We make house calls in Grafton and surrounding suburbs or you can bring your dog, cat, rabbit, guinea pig, bird, reptile or other small pet to our vet clinic in South Grafton. At Riverbank Animal Hospital our animal companions are an integral part of our families and our work. We do everything possible to assure the best opportunity for our patient?s health and a long life.\n\nBased in The Clarence Valley, Northern New South Wales, we aim to provide for all of your pet care needs. Serving Grafton, South Grafton and The Clarence Valley from Iluka to Woolgoolga.We are the only veterinary practice in the Grafton area that cares exclusively for dogs, cats, rabbits and other small pets. We do not treat horses or livestock! We have chosen to do this so that we can strive to offer the best standards of care for your family pets by being dedicated exclusively to this area of veterinary practice.\n\nOur modern progressive veterinary centre of excellence offers a full range of companion animal veterinary services. This includes medical services, pathology, x-ray, dentistry, soft tissue and orthopaedic surgery. We also offer boarding for pets that have ongoing medical needs. We have a strong emphasis on preventive medicine through regular health checks, vaccination and client education.We also have a wide range of pet accessories and stimulating toys for sale that are always being updated. We sell Advance pet foods, an Australian made quality life stage range of tasty diets to keep your dogs and cats in the best shape possible. For pets with special dietary health requirements we stock the Royal Canin Veterinary Diet range and Vets All Natural along with a wide range of natural dietary supplements.\n\nRiverbank Animal Hospital is located on the Corner of Through and Wharf Streets in South Grafton. (60 Through Street). The Riverbank Animal Hospital was officially opened by Mayor of Grafton Richie Williamson on Monday 15th March 2010.', 'null', 'reception@riverbankvet.com.au', '(02) 6642 3083', '02 6643 1700', 'South Grafton ', '60 Through St', '2460', 'NSW', 36, '-29.702579', '152.937527', NULL, 'http://riverbankvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/RiverbankAnimalHospital\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"17:30\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"17:30\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"17:30\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"17:30\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"17:30\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(40, 'Ridgehaven Veterinary Centre', 'Vets4Pets was founded in 1972 and has grown to provide a wide range of small animal veterinary care in Adelaide, through its seven convenient locations in Adelaide\'s Northern suburbs including the new Vets4Pets Dernancourt Veterinary Centre.\n\nEvery Vets4Pets local practice offers professional facilities, modern equipment and highly trained people who love animals. We believe in offering the very best in general veterinary care.\n\nA senior vet will oversee the case management and treatment of your pet for as long as you remain our client. Should your pet need a specific service (such as ultrasound, orthopaedic surgery etc), special equipment or even hospitalisation, your case manager draws upon the extensive skills and facilities of the Vets4Pets Group.', 'null', 'admin@vets4pets.com.au', '(08) 8264 7799', '08 8289 3722 ', 'Ridgehaven', '1269 North East Road', '5097', 'SA', 36, '-34.820665', '138.717232', NULL, 'http://www.vets4pets.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/vets4petssa\\/\"}', '{\"monday-from\":\"09:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"09:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"09:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"09:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"09:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(41, 'North Shore Veterinary Hospital', 'North Shore Veterinary Hospital was established 1935. NSVH serviced the local community for 80 years and prides itself on delivering the highest quality care.\n\nWe are open 24 hours 365 days a year with our skilled team always available for consultation and advice when it?s needed. Off street parking is available with lift access to the second floor.\n\nIn addition the hospital is home to North Shore Veterinary Specialist Centre, which operates independently of the general practice.', 'null', 'info@northshorevet.com.au', '(02) 9436 1213', '(02) 9436 1213', 'St Leonards', '64 Atchison Street', '2065', 'NSW', 36, '-33.822917', '151.198859', NULL, 'http://northshorevet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/northshorevethosp\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"21:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"21:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:30\",\"wednesday-to\":\"21:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:30\",\"thursday-to\":\"21:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:30\",\"friday-to\":\"21:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:30\",\"saturday-to\":\"15:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"08:30\",\"sunday-to\":\"17:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(42, 'Lara Veterinary Clinic', 'Corio Veterinary Clinic was established in 1978. We are a modern well-equipped hospital, with a caring and experienced team of veterinarians and nurses who are committed to providing the best care for your pets. We are able to offer a wide range of services including consultations, desexing & microchipping, elective and emergency surgery and home visits. Our surgical and medical equipment is kept well up to date to enhance quick and effective treatment of your pets. With good advice and professional care, we strive to give your pet the best ongoing health care.\n\nOur Lara Veterinary Clinic was opened in 1983 to cater for the ever expanding population of Lara and the surrounding districts. The Lara clinic provides a full range of services to our clients and their animals, with extended hours in the evenings for those owners working in Melbourne and travelling home to Lara. We aim to make your pet feel at ease in our Clinic with a caring and gentle approach to our treatments and consultations.\n\nWith our modern computer system, all details of your animals histories are available at the touch of a button to both clinics, which are linked \"on-line.\"', 'null', 'lara@coriovet.com.au', '(03) 5282 3243', 'null', 'Lara', '75 Forest Road', '3212', 'VIC', 36, '-38.029601', '144.395355', NULL, 'http://www.coriovet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/corioveterinaryclinic\\/\"}', '{\"monday-from\":\"08:30\",\"monday-to\":\"12:00\",\"monday-from2\":\"16:00\",\"monday-to2\":\"19:00\",\"tuesday-from\":\"08:30\",\"tuesday-to\":\"12:00\",\"tuesday-from2\":\"16:00\",\"tuesday-to2\":\"19:00\",\"wednesday-from\":\"08:30\",\"wednesday-to\":\"12:00\",\"wednesday-from2\":\"16:00\",\"wednesday-to2\":\"19:00\",\"thursday-from\":\"08:30\",\"thursday-to\":\"12:00\",\"thursday-from2\":\"16:00\",\"thursday-to2\":\"19:00\",\"friday-from\":\"08:30\",\"friday-to\":\"12:00\",\"friday-from2\":\"16:00\",\"friday-to2\":\"19:00\",\"saturday-from\