(43, 'Kwinana Veterinary Hospital', 'As Kwinana\'s longest serving veterinary hospital, we feel privileged to be given the responsibility to look after your pet. Our veterinarians have a combined experience of over  120 years, and are ready to offer the best standards of care for you and your pet.\nAt Kwinana Veterinary Hospital, we pledge to provide personalised, professional and affordable health care for your family pet. You?ll be fully supported with sound advice first and foremost. We know that  helping our clients starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you?ll be well equipped to make the best ongoing health care decisions for your pet.', 'null', 'mail@kwinanavet.com.au', '08 9419 1346', ' 9419 1346', 'Kwinana Town Centre ', '36-38 Meares Avenue', '6167', 'WA', 36, '-32.244782', '115.816581', NULL, 'http://www.kwinanavet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/kwinanavethospital\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"16:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"08:00\",\"sunday-to\":\"12:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
