(45, 'Parramatta Veterinary Hospital', 'Parramatta Veterinary Hospital is conveniently located next to the heart of the Parramatta CBD. It cares for pets from surrounding areas including Dundas, Ermington, Guildford, Carlingford and Northmead.\n\nThe Hospital was renovated 4 years ago and is now able to offer an unprecedented level of services. It includes a new state of the art surgical theatre, digital xray and ultrasonography, doggy day care and boarding facilities for both cats and dogs.\n\nParramatta Veterinary Hospital has a large team of caring and experienced vets and nurses who work hard to ensure each and every pet gets absolute gold standard care.', 'null', 'info@parramattavet.com.au', '(02) 9630 5520', '(02) 9436 1213 ', 'North Parramatta', '100 Grose St', '2151', 'NSW', 36, '-33.807349', '151.012702', NULL, 'http://parramattavet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/ParramattaVeterinaryhospital\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"20:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"16:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"10:00\",\"sunday-to\":\"12:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(46, 'Paralowie Veterinary Surgery', 'Paralowie Veterinary Surgery is a full service animal hospital dedicated to the treatment and care of domestic and exotic pets', 'null', 'info@paralowievet.com.au', '(08) 8258 4818', 'null', 'Paralowie', '136 Waterloo Corner Road', '5108', 'SA', 36, '-34.754881', '138.628854', NULL, 'http://www.paralowievet.com/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/ParalowieVet\\/\"}', '{\"monday-from\":\"00:00\",\"monday-to\":\"00:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"00:00\",\"tuesday-to\":\"00:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"00:00\",\"wednesday-to\":\"00:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"00:00\",\"thursday-to\":\"00:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"00:00\",\"friday-to\":\"00:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"00:00\",\"saturday-to\":\"00:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(47, 'Papamoa Vets Vets', 'Our team of experienced veterinary surgeons - Paul, Steve, Marcus, Sonia, Justis and Dione - offer a full range of medical and surgical procedures.  We provide a 24hr service so no matter when you may require vet care for your pet there will be a highly skilled professional available.  We also have knowledgeable and talented support staff including our practice manager Jill, qualified Veterinary Nurses Debby, Mel, Cinnamon, Brooke, Katie, Kylie, Torie, and receptionist Wendy.  Nicky also run\'s our popular and informative puppy pre-school classes from both the Bayfair & Papamoa clinics.\n\nBoth our clinics offer a wide range of quality pet foods, pet care products and accessories.  If you have any questions about feeding and looking after your pets, then feel free to give us a call or pop in and see us.   aunganui Ve   Mt Vets   ts\n\nWe operate via an appointment system to avoid unnecessary waiting, so please give us a call to arrange a suitable time. We realise how difficult it can be to get to the vets during a typical working day and therefore have designed our opening hours to be as flexible as possible. ', 'null', 'info@papamoavets.co.nz', '075 720 441', ' 07 572 0441', 'Papamoa Beach, Papamoa', '3 Percy Road', '3118', 'NZ', 554, '-37.698382', '176.284356', NULL, 'http://bayfairandpapamoavets.co.nz/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/bayfairandpapamoavets\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"17:30\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"17:30\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"17:30\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(48, 'Ourimbah Veterinary Hospital', 'Best Care for Pets and People.... at Ourimbah Veterinary Hospital our aim is to provide you and your pet with the highest quality in veterinary medicine and surgery.\n\nWe want you to feel welcome each and every time you speak with or visit us. We want your pet to enjoy their visit and eagerly return. We will strive to attain this with our gentle methods using positive reinforcement techniques only. Our team is our most valuable resource in our service commitment to you. Communication is key to great service and we will always listen to your concerns and ensure you are fully informed at every step. \n\nWe advocate preventative health for longevity and quality of life, and provide treatment options when prevention is not enough. We are dedicated to caring for your pet from birth to old age and have a wide range of experience with both small and large animals.\n\nOurimbah Veterinary Hospital was established in 1982 as a one-vet operation.  In 1992 we moved into our current premises, a purpose-built small animal and horse hospital. Over the past three decades we have grown substantially and now have 5 full time and two part time vets with about 10 support staff. We are one of the only truly mixed veterinary hospitals on the Central Coast and look after all types of animals large and small including dogs, cats, birds, rabbits and guinea pigs, wildlife of all kinds, horses, cattle, sheep, goats and alpacas. \n\nOur hospital is fully equipped with both small animal and equine surgical theatres, x-ray and ultrasound facilities, dental facilities, in-hospital diagnostic laboratory, separate dog and cat wards, isolation ward and much more. We offer a large range of surgical services which include orthopaedics and soft tissue surgery, as well as routine procedures such as desexing. ', 'null', 'info@ourimbahvet.com.au', '(02) 4362 1644', 'null', 'Ourimbah', '10 Pacific Hwy', '2258', 'NSW', 36, '-33.354033', '151.369889', NULL, 'http://www.ourimbahvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/ourimbahvet\\/\"}', '{\"monday-from\":\"08:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:30\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:30\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:30\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:30\",\"saturday-to\":\"13:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"09:00\",\"sunday-to\":\"11:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(49, 'Northgate Veterinary Hospital', 'Vets4Pets was founded in 1972 and has grown to provide a wide range of small animal veterinary care in Adelaide, through its seven convenient locations in Adelaide\'s Northern suburbs including the new Vets4Pets Dernancourt Veterinary Centre.\n\nEvery Vets4Pets local practice offers professional facilities, modern equipment and highly trained people who love animals. We believe in offering the very best in general veterinary care.\n\nA senior vet will oversee the case management and treatment of your pet for as long as you remain our client. Should your pet need a specific service (such as ultrasound, orthopaedic surgery etc), special equipment or even hospitalisation, your case manager draws upon the extensive skills and facilities of the Vets4Pets Group.', 'null', 'admin@vets4pets.com.au', '(08) 8367 9555', '08 8289 3722 ', 'Greenacres', '21 Fosters Road', '5086', 'SA', 36, '-34.869465', '138.63665', NULL, 'http://www.vets4pets.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/vets4petssa\\/\"}', '{\"monday-from\":\"09:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"09:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"09:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"09:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"09:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
