(50, 'New Norfolk Vet Centre', 'Our Veterinary Hospital provides modern, professional and affordable health care for your pets.\nWe aim to make your pet feel at ease in our hospital with a caring and gentle approach to treatment and consultations.\nAt our Vet Centres, you will be fully supported with sound advice first and foremost. We know that helping our clients starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you will be well equipped to make the best ongoing health care decisions for your pet.\n\nWith an 100 year old fa?ade which was renovated and expanded in 2010, our main hospital at Montrose Veterinary Centre, has fully equipped examination rooms, diagnostic equipment ? in house blood analysers and microscopy, multiple operating theatres, a range of imaging technology ? radiography, ultrasound and endoscopy, and pharmaceutical stores to enable us to provide on-the-spot assistance for almost all pet health and medical needs. We also have a range of rehabilitation equipment ? Accell therapy and Water-Walker underwater treadmill.\nOpen 7 days a week including all public holidays (except Christmas Day).', 'null', 'newnorfolk@vetcentre.net.au', '(03) 6261 1573', '1300 302 912', 'New Norfolk', '57 Burnett Street', '7140', 'TAS', 36, '-42.782311', '147.062683', NULL, 'http://www.vetcentre.net.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/newnorfolkvetcentre\\/\"}', '{\"monday-from\":\"09:00\",\"monday-to\":\"18:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"09:00\",\"tuesday-to\":\"18:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"09:00\",\"wednesday-to\":\"18:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"09:00\",\"thursday-to\":\"18:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"09:00\",\"friday-to\":\"18:00\",\"friday-from2\":\"00:00\",\"