(53, 'Midland Veterinary Hospital', 'Vetwest have been Perth\'s local vets for over 20 years. We exist today because thousands of WA pet owners have been delighted with the compassion we provide to them and the care we provide to their companions. Our team is made up of people that truly love animals, and have dedicated their working careers to veterinary medicine.\n\nWe have purpose built facilities with an extensive range of diagnostic equipment and are committed to continuous improvement, namely the medical treatment and care of pets, the working conditions of our team, the service we provide to our clients, and promoting responsible pet ownership in the community.', 'null', 'marketing@vetwest.com.au', '(08) 9274 3299', '08 9404 1111', 'Midvale', '231 Morrison Rd', '6056', 'WA', 36, '-31.891219', '116.020204', NULL, 'https://www.vetwest.com.au/midland-vet', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/vetwest?ref=hl\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:30\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:30\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:30\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"17:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"08:00\",\"sunday-to\":\"13:00\",\"sunday-from2\":\"?????\",\"sunday-to2\":\"00:00-00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(54, 'Mawson Lakes Veterinary Hospital', 'Vets4Pets was founded in 1972 and has grown to provide a wide range of small animal veterinary care in Adelaide, through its seven convenient locations in Adelaide\'s Northern suburbs including the new Vets4Pets Dernancourt Veterinary Centre.\n\nEvery Vets4Pets local practice offers professional facilities, modern equipment and highly trained people who love animals. We believe in offering the very best in general veterinary care.\n\nA senior vet will oversee the case management and treatment of your pet for as long as you remain our client. Should your pet need a specific service (such as ultrasound, orthopaedic surgery etc), special equipment or even hospitalisation, your case manager draws upon the extensive skills and facilities of the Vets4Pets Group.', 'null', 'admin@vets4pets.com.au', '(08) 8349 8955', '08 8289 3722', 'Mawson Lakes', '31 Main Street', '5095', 'SA', 36, '-34.807512', '138.616753', NULL, 'http://www.vets4pets.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/vets4petssa\\/\"}', '{\"monday-from\":\"09:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"09:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"09:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"09:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"09:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(55, 'Matraville Vet Hospital', 'Matraville Vet Hospital aims to produce the best possible results at all times. We have an extensive range of services offered in house to give you test results and diagnoses as quickly as possible. Our surgeons are capable of performing complex orthopedic and soft tissue surgery.\n\nThe Hospital has recently undergone renovation so as to provide you and your pet with top of the range Veterinary care.\nWe have a large team of caring and experienced vets and nurses who are part of the local pet loving community.\n\nThere is plentiful on site parking and long hours 7 days a week. We are open until 8pm on weekdays and 6pm Saturdays, Sundays and public holidays.', 'null', 'matravet@bigpond.net.au', '(02) 9311 1444', 'null', 'Matraville', '525 Bunnerong Rd', '2036', 'NSW', 36, '-33.95997', '151.231588', NULL, 'http://www.vetfriends.com.au/matraville-veterinary-hospital', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/MatravilleVeterinaryHospital\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"20:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"20:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:30\",\"wednesday-to\":\"20:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:30\",\"thursday-to\":\"20:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:30\",\"friday-to\":\"20:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"18:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"09:00\",\"sunday-to\":\"18:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(56, 'Mandurah South Veterinary', 'Our Veterinarians & Veterinary Nurses pride themselves on providing the same love and care to all patients great and small. Our clinic also has an adoption program in place for Kittens and Cats and we have successfully found new homes & provided a second chance to many. If going to the Coastal Clinic you might even get to meet our resident clinic cat Tilly who has won the hearts of many including all of the staff and even placed Top 50 in clinic cat of the year in Australia.\n\nIf we have done our job well please feel free to let us know! We love to hear feedback & your compliments let us know that we are doing our job well and allows us to acknowledge the staff involved.\n\nWe have an online Facebook community, so feel free to follow us to keep up to date with what?s going on in the clinics and any special promotions we might be running and of course to share pictures of your furry friends!\n\nIf you ever experience a problem or have a suggestion for us on how we could expand or improve our service, please don?t hesitate to contact the clinics directly so that we can address the issue. We look forward to getting to know you & your pets over the years ahead.\n\nYours Sincerely,\n\nThe Mandurah South & Coastal Veterinary Team', 'null', 'info@coastalvet.com.au', '08 9534 6003', '(08) 9412 5700', 'Falcon', 'Shop 3/609 Old Coast Road', '6210', 'WA', 36, '-32.580818', '115.663433', NULL, 'http://coastalvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/CoastalVeterinaryClinic\\/\"}', '{\"monday-from\":\"08:30\",\"monday-to\":\"18:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:30\",\"tuesday-to\":\"18:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:30\",\"wednesday-to\":\"18:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:30\",\"thursday-to\":\"18:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":