(59, 'Lincoln Veterinary Centre', 'OUR WAITING ROOM\n\nA highly professional veterinary clinic that provides the highest standard service, Lincoln Vet Centre typically see dogs, cats, rodents, sheep, cattle, reptiles and birds. \n\nLincoln Veterinary Centre is made up of a team of qualified, passionate and dedicated Veterinarians. \n\nOur Port Lincoln based clinic provides quality veterinary care both within the local community, but we also service a much broader geographic area by visiting the more remote townships of Eyre Peninsula. \n\n\nRAVENDALE HOUSE\nOur modern clinic is set in the heritage listed Ravendale House in Port Lincoln. Built in 1842, the beautifully appointed Ravendale House was originally built as a residence of quality for Her Majesty Queen Victoria?s Colonial Officers. \n\nBuilt with locally sourced and trimmed limestone, the site originally included a chapel, fresh water well, open air bath, court room and dwelling. Ravendale house showcases British-Indian influenced architectural features such as French doors above ground level, keystones and vents above windows, white teak joints, Baltic pine rafters and matchwood ceilings. \n\nAlthough the facade of the house remained untouched, extensive renovations were undertaken to build a purpose built, architecturally designed veterinary clinic with modern facilities and surgical equipment.\n\nThe result is a fresh, clean and light filled clinic where both clients and their animals feel at home and can be provided with the highest quality vet care. \n\n\nOUR MISSION\n\n\nTo passionately educate our clients to an exemplary and uncompromised standard of health and wellbeing for their pets.\n\nTo continue our professional development and advancement of skills to provide the highest level of care possible.', 'null', 'info@lincolnvet.com.au', '(08) 8682 3100', '0427 823 100', 'Port Lincoln', '20 Windsor Avenue', '5606', 'SA', 36, '-34.743323', '135.853664', NULL, 'https://www.lincolnvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/Lincoln-Veterinary-Centre-1750357988524962\\/\"}', '{\"monday-from\":\"08:30\",\"monday-to\":\"17:30\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:30\",\"tuesday-to\":\"17:30\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:30\",\"wednesday-to\":\"17:30\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:30\",\"thursday-to\":\"17:30\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:30\",\"friday-to\":\"17:30\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:30\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
