(62, 'Erina Heights Vet Hospital', 'We are committed to enhancing that bond by improving the duration and quality of your pets? life. We provide high quality diagnostic, medical and surgical care of pets by a commitment to ongoing continuing professional development of both vets and our nursing staff.\n\nCORE VALUES\nTo be compassionate and gentle when caring for your pet.\n\nTo keep your pet comfortable and in minimal pain when in our care.\n\nTo keep you informed at all times of your pets? progress, and to fully involve you in the decision-making process.\n\nTo commit to the continuing education of all our team in order to provide the highest level of professional medical, surgical and diagnostic skills for your pet.\n\nTo show you - the owner; our understanding, respect, and empathy at all times while your pet is under our care.\n\nOur team understands that special bond between you and your pets ... PETS ARE FAMILY!', 'null', 'info@erinaheightsvet.com.au', '(02) 4384 5888', 'null', 'Wamberal', '661 Central Coast Highway', '2260', 'NSW', 36, '-33.423447', '151.431899', NULL, 'http://www.erinaheightsvet.com.au/index.html', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/ErinaHeightsVet\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"18:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"18:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"18:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"18:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"18:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"09:00\",\"sunday-to\":\"12:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(63, 'East Bentleigh Vet Clinic', 'At East Bentleigh Vet Clinic, we are passionate about providing the best possible quality care for you and your pets that Melbourne has to offer. Our skilled and caring team offer high quality diagnostic, therapeutic and veterinary health care services for your pets at every stage of their life.\n\nWe are a young, enthusiastic, but experienced team who take pleasure in getting to know you and your pet personally, in order to cater for your individual needs. We realise that we are privileged to be entrusted to care for your special family member.\n\nWe offer exceptional veterinary care to pets from East Bentleigh, Bentleigh, McKinnon, Murrumbeena, Hughesdale, Carnegie, Hampton East, Oakleigh South, Highett, Moorabbin, Oakleigh, Clarinda, Caulfield and the surrounding areas.\n\nEmail us directly at info@eastbentleighvet.com.au', 'null', 'info@eastbentleighvet.com.au', '03 9579 3430', 'null', 'Bentleigh East', '172 East Boundary Road', '3165', 'VIC', 36, '-37.919094', '145.060006', NULL, 'http://www.eastbentleighvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/eastbentleighvetclinic\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:30\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:30\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:30\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"07:30\",\"saturday-to\":\"13:30\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"09:00\",\"sunday-to\":\"13:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(64, 'Dernancourt Veterinary Clinic', 'The new Vets4Pets pet clinic, \"Dernacourt Veterinary Centre\" is now open.\n\nAt the Dernancourt Veterinarty Centre, Vets4Pets duly provides pet and veterinarian services, vaccinations, microchipping, pet insurance and animal care for the surrounding suburbs of Dernancourt, Paradise, Athelstone, Highbury, Hope Valley, Holden Hill and Newton in Adelaide.\n\nVets4Pets understand you love your pet, so a senior vet of your choice will organise the management and treatment of your animal companion for as long as you remain our client.', 'null', 'admin@vets4pets.com.au', '(08) 8365 6177', '08 8289 3722 ', 'Dernancourt', '850 Lower North East Rd', '5035/5075', 'SA', 36, '-34.861013', '138.684378', NULL, 'http://www.vets4pets.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/vets4petssa\\/\"}', '{\"monday-from\":\"09:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"09:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"09:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"09:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"09:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"13:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(65, 'Corio Veterinary Clinic', 'Our dedicated team is always here for your pets\n\nCorio Veterinary Clinic was established in 1978. We are a modern well-equipped hospital, with a caring and experienced team of veterinarians and nurses who are committed to providing the best care for your pets. We are able to offer a wide range of services including consultations, desexing & microchipping, elective and emergency surgery and home visits. Our surgical and medical equipment is kept well up to date to enhance quick and effective treatment of your pets. With good advice and professional care, we strive to give your pet the best ongoing health care.', 'null', 'clinic@coriovet.com.au', '(03) 5275 4575', '(03) 5222 2139 ', 'Corio', '96 Bacchus Marsh Road', '3214', 'VIC', 36, '-38.076059', '144.358977', NULL, 'http://www.coriovet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/corioveterinaryclinic\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"18:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"18:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"18:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"18:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"18:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:30\",\"saturday-to\":\"16:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(66, 'Coast Animal Health Lakehaven', 'Our experienced and dedicated team at Coast Animal Health Lakehaven (located on Wallarah Road Kanwal) provides a professional veterinary service in a safe and caring environment.\n\nOur state of the art hospital is fully equipped.  \nTogether with our dedicated team, we provide the ultimate care for your pet.  Our staff receives ongoing training to ensure up to date advice.\n\nCoast Animal Health is totally committed to giving your pet the best care while ensuring you receive friendly and courteous service.  Our team is here to guide you with your pet\'s continuing good health and well-being.\n\nOur veterinary team understands how important your furry friends are to your family.  All of our Vets are fully qualified. Plus, we\'re a proud member of the Australian Veterinary Association\nWhether It\'s preventative treatments, looking at a specific problem, or an emergency, Coast Animal Health has you covered.', 'null', 'info@coastanimalhealth.com.au', '(02) 4392 8822', 'null', 'Kanwal', '231 Wallarah Rd', '2259', 'NSW', 36, '-33.252098', '151.490875', NULL, 'http://coastanimalhealth.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/Coast-Animal-Health-Lakehaven-193047057389239\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"11:00\",\"monday-from2\":\"15:00\",\"monday-to2\":\"18:30\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"11:00\",\"tuesday-from2\":\"15:00\",\"tuesday-to2\":\"18:30\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"11:00\",\"wednesday-from2\":\"15:00\",\"wednesday-to2\":\"18:30\",\"thursday-from\":\"08:00\",\"thursday-to\":\"11:00\",\"thursday-from2\":\"15:00\",\"thursday-to2\":\"18:30\",\"friday-from\":\"08:00\",\"friday-to\":\"11:00\",\"friday-from2\":\"15:00\",\"friday-to2\":\"18:30\",\"saturday-from\":\"09:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"14:00\",\"saturday-to2\":\"17:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NUL