(67, 'James Street Veterinary Hospital', 'There for when you need quality, high trained staff in preventative, routine and emergency care who really care for your pet like it is one of our own.', 'null', 'info@jstvet.com.au', '(07) 3807 4113', 'null', 'Beenleigh', '13 James Street ', '4207', 'QLD', 36, '-27.717818', '153.199431', NULL, 'https://jstvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/jstvet\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"18:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"18:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"18:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"20:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"18:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"14:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"09:00\",\"sunday-to\":\"14:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(68, 'Indooroopilly Veterinary Clinic', 'The aim of Indooroopilly Vet Clinic is to provide friendly, professional and high quality pet care. Indooroopilly Vet Clinic is constantly updating, improving skills and equipment to provide the best possible care and services to your pet. Our vets and nurses attend continuing education and training seminars to keep up to date with the latest trends in veterinary science.\n\nA few of our services include annual health checks, senior health checks, vaccinations, desexing, microchipping, in house pathology, blood pressure monitoring, puppy pre-school, hydrobath, behavioural advice, nutritonal advice and parasite control.', 'null', 'reception@indvet.com.au', '(07) 3878 9766', '07 3878 9766', 'Indooroopilly', 'Moggill Road & Russell Terrace', '4068', 'QLD', 36, '-27.500673', '152.966492', NULL, 'http://www.indooroopillyvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/Indooroopillyvet\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"18:30\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"18:30\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:30\",\"wednesday-to\":\"18:30\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:30\",\"thursday-to\":\"18:30\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:30\",\"friday-to\":\"18:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"15:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(69, 'Guildford Veterinary Hospital', 'In 1955 the clinic opened it?s doors for the very first time. Over the past 55 years the clinic has grown with the addition of 2 buildings and great clients. The clinic is fitted out with 2 consulting rooms, large treatment room, operating theatre, radiology room and a large kennel room with divisions between the cats and dogs.\n\nThey have a large off street parking for up to 15 cars, which allows easy access with your four legged friend.\n\nThey look forward to welcoming you and your pets to Guildford Veterinary Hospital as part of our family.', 'null', 'info@guildfordvet.com.au', '(02) 9632 0239', 'null', 'Guildford', '352 Woodville Rd', '2162/2161', 'NSW', 36, '-33.854472', '150.995138', NULL, 'http://www.vetfriends.com.au/veterinary-hospital-guildford', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/guildfordvetfriends\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"18:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"18:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"18:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"18:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"18:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"14:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(70, 'Greenfields Vet Hospital', 'PROFESSIONAL CARE FOR YOUR PETS\nHere at Greenfields Veterinary Hospital, we strive to provide you with professional, gold standard health care for your pets.  We aim to make all members of your family feel at ease in our clinic with a caring and gentle approach to consultations and treatment.\n\nOur dedicated staff are all passionate about pets and are avid animal lovers.\n\nGreenfields veterinary hospital has been an integral part of the Mandurah community since its establishment in 2002.  In that time, we have helped thousands of pets in Mandurah and the surrounding areas.  Being highly integrated in our community is very important to us, and our clients know from experience that they can rely on us for expert advice and treatment options.\n\nOur mission at Greenfields Veterinary Hospital is to provide an excellent surgical and medical service to our patients along with outstanding customer service to their human companions.\n\nOur highest priority is the safety and comfort of your pet when undergoing any procedure.  Of course, every anaesthetic and surgical procedure carries some degree of risk.  It is our aim to ensure that you, as an owner, are completely aware of the procedure being undertaken and any associated risks, and are kept completely informed from start to finish.\n\nIn order to reduce the risk of complications associated with any sedation or anaesthetic, your veterinary surgeon will perform a thorough clinical examination and evaluation of your pet.  Unfortunately, it is not possible to eliminate all of the possible complications that may arise.  To minimalise potential risks, we offer a full range of services.\n\nOur Services\n\nWith a vast wealth of knowledge and experience, our veterinarians and nursing staff pride themselves on providing the highest standard of veterinary care.  Our hospital is equipped with an extensive array of equipment to help us efficiently diagnose and treat all medical and surgical cases.\n\nThis includes:\n\nModern digital x-ray developer\nState of the art orthopaedic equipment\nIn-house diagnostic laboratory equipment\nSurgical microscope\nPhacoemulsifier for cataract surgery\nAdvanced anaesthetic monitoring machines and brand new dental machine\nHeated surgery tables and ?bear hugger? to keep our patients warm under anaesthesia\nIntensive care hospitalisation and isolation wards\nBrand new stainless steel kennels\nExtensive in-hospital pharmacy\n\nPayment\n\nWherever possible, an estimate of costs is always provided to our clients prior to procedures being performed.  However, the may vary due to unforeseen circumstances.\n\nAll accounts are payable at the time of discharge.  We accept cash, ETPOS and VISA/Mastercard payments.  The hospital also uses VetPay to assist clients who are experiencing financial difficulty.\n\nOur hospital receives no financial support for the Government or any charitable institutions, so prompt payment of fees enables us to continue providing our clients with the very best veterinary care.', 'null', 'info@greenfieldsvet.com.au', '(08) 9581 7766', '08 9412 5700', 'Greenfields', '4/39 Gordon Rd', '6210', 'WA', 36, '-32.511409', '115.745516', NULL, 'http://greenfieldsvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/Greenfields-Vet-Hospital-202030409828074\\/\"}', '{\"monday-from\":\"07:00\",\"monday-to\":\"18:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:00\",\"tuesday-to\":\"18:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:00\",\"wednesday-to\":\"18:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:00\",\"thursday-to\":\"18:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:00\",\"friday-to\":\"18:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"07:00\",\"saturday-to\":\"15:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"08:00\",\"sunday-to\":\"17:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(71, 'Golden Grove Emergency Hospital', 'Looking for a Golden Grove Vet?\nIf you are looking for a vet in Tea Tree Gully or Newton, the Golden Grove vet team is happy to cater to your needs. We provide 24 hour treatment and supervision of all our veterinary hospital patients and can handle even the most demanding treatments.\n\nVets4Pets\' Emergency Veterinary Hospital is open 24 hours a day, 7 days a week, 365 days a year and is situated at Golden Grove. For residents in Newton and Tea Tree Gully, our vet offers a convenient location that is a quick drive away. Your pet will have immediate access to a professionally trained team with advanced equipment to provide emergency treatment. Our doctors and nurses ensure a pleasant and friendly environment for both patients and their owners.', 'null', 'admin@vets4pets.com.au', '(08) 8289 3722', '08 8289 3722', 'Wynn Vale', '103 The Golden Way', '5127', 'SA', 36, '-34.799995', '138.685881', NULL, 'http://www.vets4pets.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/vets4petssa\\/\"}', '{\"monday-from\":\"00:00\",\"monday-to\":\"00:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"00:00\",\"tuesday-to\":\"00:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"00:00\",\"wednesday-to\":\"00:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"00:00\",\"thursday-to\":\"00:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"00:00\",\"friday-to\":\"00:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"00:00\",\"saturday-to\":\"00:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"00:00\",\"sunday-to\":\"00:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(72, 'Glenhaven Vet Hospital', 'We\'re a big part of our local community!\n\nOur Veterinary Hospital has been an integral part of our local community for nearly 25 years, servicing Glenhaven, Dural, Kenthurst, Castle Hill, Kellyville and Cherrybrook areas. In that time, we?ve helped thousands of our clients cats and dogs, rabbits and guinea pigs, birds, and even a few snakes. We are the longest standing sponsor of Winston Hills Little Athletics Club. We sponsor local school fetes and sports days. We support the annual Glenhaven Carol Concert. We donate to local SES and Bush Fire Brigades, and sponsor six children in Africa.\n\nBeing so strongly integrated with our local community is important to us and our clients. Our customers know by experience that they can rely on us for sound advice and treatment options and that their pet is in the very best hands with our team.', 'null', 'info@glenhavenvet.com.au', '(02) 9894 6344', '02 9639-7744', 'Glenhaven', '442 Old Northern Rd', '2156', 'NSW', 36, '-33.706268', '151.011365', NULL, 'http://www.glenhavenvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/gwhvh\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"15:00\",\"saturday-to2\":\"18:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
