(73, 'Gladesville Veterinary Hospital', 'Gladesville Veterinary was one of the first purpose-built veterinary practices in Sydney. The premises have continued to be upgraded since the hospital?s establishment in 1959 and boasts state of the art facilities for both staff and patients. In addition to founder Perry Manusu, past partners in the practice include Harry Cooper and Bob Ratcliffe, Max Zuber, Pam Short and Barry Young.\n\nOver the many decades that GVH has been servicing the community and its pets, we feel that a real family has grown. We consider our clients an important part of that family, and we know that they feel the same way.', 'null', 'vet@gladesvillevet.com.au', '(02) 9817 5758', '9436 1213', 'Gladesville', '449 Victoria Road', '2111', 'NSW', 36, '-33.822647', '151.122862', NULL, 'https://gladesvillevet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/GladesvilleVet\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"20:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"20:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"20:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"20:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"20:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"15:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"08:00\",\"sunday-to\":\"17:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(74, 'Figtree Veterinary Clinic', 'The Figtree Veterinary Clinic in Lane Cove provides modern, professional and affordable health care for your pets. They aim to make your pet feel at ease in the clinic with a caring and gentle approach to treatment and consultations. The dedicated staff and leading veterinarians are all passionate about pets and avid animal lovers. They are the first choice for pets in Lane Cove West, Woolwich, Linley Point and Hunters Hill.\n\nAt Figtree Veterinary Clinic, you will be fully supported with sound advice first and foremost. They know that helping clients starts with providing a good understanding of health care issues and treatment options.\n\nYou can find them at rear of 225 Burns Bay Road Lane Cove. Enter via Beatrice St where you will find a large car park out the front.\n\nWith fully equipped examination rooms, diagnostic machines and pharmaceutical stores they provide on-the-spot assistance for all pet health and medical needs.', 'null', 'info@figtreevet.com.au', '02 9428 4700', '(02) 9436 1213', 'Lane Cove', 'Shop 10/225 Burns Bay Road', '2066', 'NSW', 36, '-33.815818', '151.151857', NULL, 'http://figtreevet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/FigtreeVet\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"16:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NUL