(75, 'Ferntree Gully Veterinary Hospital', 'As pet owners ourselves, we understand the loyalty, love and enjoyment pets bring into our lives. At Ferntree Gully Veterinary Hospital, you can be sure that your special pet will always receive the best possible care and attention, just as we have been doing for over 30 years.', 'null', ' info@ftgvet.com.au', '(03) 9758 4055', 'null', 'Upper Ferntree Gully', '1288 Burwood Hwy', '3156', 'VIC', 36, '-37.893855', '145.312837', NULL, 'http://ferntreegullyvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/ferntreegullyvet\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"20:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"20:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:30\",\"wednesday-to\":\"20:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:30\",\"thursday-to\":\"20:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:30\",\"friday-to\":\"20:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"17:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"10:00\",\"sunday-to\":\"12:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(76, 'Fairford Rd Animal Hospital', 'The Fairford Road Animal Hospital is located in Bankstown off Gow Street near the Fairford Road overpass of Canterbury Road. We see pets from all over the area.\n\nThe Hospital offers a range of services including Consultations, Checkups, Vaccinations, Puppy School with an Accredited Delta Trainer, Dog and Deluxe Cattery Boarding, Pet Care Information and Supplies, Adoptions, Digital Radiology, Blood Testing, Surgical and Hospital Care. \n\nWe are open 7 days a week. You can park right out the front.\n\nPlease note that Fairford Road Animal Hospital is NO LONGER the pound for the Canterbury Council\n\nWe have qualified caring and committed Staff.', 'null', 'info@fairfordroad.com.au', '(02) 9709 6844', 'null', 'Bankstown', '2 Short Street', '2200', 'NSW', 36, '-33.935017', '151.03691', NULL, 'http://www.vetfriends.com.au/animal-hospital-bankstown', NULL, '{\"monday-from\":\"09:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"09:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"09:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"09:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"09:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"09:00\",\"sunday-to\":\"12:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(77, 'Epping Veterinary Clinic', 'The Epping Vet is a long established landmark on Carlingford Rd Epping. Its been serving the Epping, Carlingford, Marsfield and North Rocks community for over 50 years. The Clinic has a team of over 4 Veterinarians and a wonderful team of nurses and kennel hands from the local area.\n\nThe Epping Vet Clinic includes a state of the art surgery, radiology and consulting rooms. On the lower level there is a deluxe cattery for boarding.\n\nYou can park out the front and the Clinic is open long hours every day and on weekends to ensure the very best of care is always available.\n\nOur clinic runs by appointment. Please call to make a booking.', 'null', 'info@eppingvet.com.au', '(02) 9869 2771', 'null', 'Epping', '76 Carlingford Rd ', '2121', 'NSW', 36, '-33.772694', '151.071818', NULL, 'https://www.eppingvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/eppingvetclinic\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"16:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"10:00\",\"sunday-to\":\"16:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(78, 'Engadine Veterinary Hospital', 'Engadine Veterinary Hospital has been caring for shire pets since 1968 and the current owner Dr Finlay Burrows has been at the practice since 1999. Engadine Veterinary Hospital has a caring and very experienced team who are dedicated to the well being of your pet.', 'null', 'info@engadinevet.com.au', '(02) 9548 3345', '02 9548 3345 ', 'Engadine ', '903 Princes Highway', '2233', 'NSW', 36, '-34.060923', '151.020708', NULL, 'http://www.engadinevet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/EngadineVeterinaryHospital\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"13:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"09:00\",\"sunday-to\":\"12:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(79, 'Eastside Veterinary Emergency and Specialists', 'Eastside Veterinary Emergency & Specialists was established in order to provide around the clock animal care in the Eastern Suburbs of Sydney. We are open when your local veterinary clinic is closed to ensure that you are able to access the best care for your pet irrespective of the time of day.\n\nIn addition to offering after hours emergency veterinary care, we offer a variety of specialist medical, surgical and dermatology appointments for animals during regular business hours. These are available Monday ? Friday from 8:30am to 6pm.\n\nThe services we offer range from standard consultations and prescriptions through to medical imaging, pathology and surgery. We can also accommodate your animal during times of illness that require extended periods of hospitalisation.\n\nEastside Vets is a hospital that works closely with many local emergency animal hospitals in Sydney. We strive to complement these partner services and to be an extension of the care provided by your local family vet clinic.\n\nWe have veterinarians and nurses on site all day, every day. Our rotating roster of trained veterinary professionals ensure that there will always be someone available to provide the best care for your much loved pet.\n\nPlease keep in mind that our specialist vet services require a scheduled appointment and are only available during the above stated business hours.', 'null', 'info@eastsidevets.com.au', '(02) 9371 6959', '02 9197 5800 ', 'Rose Bay', '10 Newcastle St', '2029', 'NSW', 36, '-33.870359', '151.267144', NULL, 'http://www.eastsidevets.com.au/', NULL, '{\"monday-from\":\"06:00\",\"monday-to\":\"00:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"06:00\",\"tuesday-to\":\"00:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"06:00\",\"wednesday-to\":\"00:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\"