(80, 'Cremorne Veterinary Hospital', 'The Cremorne Veterinary Hospital is the original Vet in Mosman with over 50 years of service to pets across the lower North Shore. While a lot has changed in that time, our dedication to caring for your pets has not. The new purpose built Hospital is conveniently located opposite the Metropole Centre on the Mosman side of Spofforth St., just one block down from Military Rd. There is on site parking.\n\nWhile we know most of the locals from Mosman, Cremorne and Neutral Bay, people bring their pets from all over Sydney.\n\nLed by Dr. Louise Stevenson, Cremorne Veterinary Hospital offers one of the most experienced and dedicated Veterinary teams in Sydney. Dr Louise Stevenson is an accredited AQIS veterinarian who can assist in the medical certification of pets for overseas relocation.', 'null', 'info@cremornevet.com.au', '(02) 9953 1090', '(02) 9436 4884', 'Mosman', '73a Spofforth St', '2088', 'NSW', 36, '-33.829326', '151.230331', NULL, 'http://cremornevet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/cremornevet\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"15:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"10:00\",\"sunday-to\":\"12:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(81, 'AdelaideVet Prospect', 'AdelaideVet - Prospect, Goodwood Road, Stirling, and Trinity Gardens are privately owned veterinary practices located in South Australia.\n\nOur hospital facilities are on a par with modern human hospitals, including an X-ray and ultrasound suite, state-of-the-art anaesthetic monitoring, ECG, flexible endoscope for investigating gastrointestinal and respiratory problems, and automatic intravenous fluid pumps for hospitalised animals. This enables us to provide a wide range of services from standard desexing to complex diagnostic investigations, advanced surgery or intensive medical care.\n\nWe aim to set the standard for quality in veterinary healthcare, by providing you and your pets with outstanding service.  We are more than your pet\'s hospital. We are their General Practitioner, Dentist, Surgeon, Pharmacist, Paediatrician, Radiologist, Nutritionist, Intensive Care Team, Pet Store, Animal Advice Centre, Emergency Centre and after hours team.\n\nAdelaideVet Trinity Gardens, Prospect and Stirling have all been awarded the status of ?Hospital of Excellence? by the Australian Small Animal Veterinary Association. This award is in recognition of the excellent facilities provided at our hospital.', 'null', 'info@adelaidevet.com.au', '08 8169 9733', '8169 9777', 'Prospect  ', '318 Prospect Road', '5082', 'SA', 36, '-34.870626', '138.592538', NULL, 'https://adelaidevet.com.au/about/locations/adelaidevet-prospect', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/adelaidevet\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"20:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"20:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-