(82, 'Clayfield Veterinary Clinic', 'The Clayfield Veterinary Clinic has been in operation in it\'s current location in Brisbane\'s inner North since 1965.\n\nThe practice principals, Calum and Joanne Robertson, graduated together from the University of Queensland in 1986. They first worked in small animal clinics in Sydney until 1989. A 3 year stint locuming throughout the United Kingdom then saw them return to Brisbane in 1992.\n\nCalum and Joanne bought the Clayfield Veterinary Clinic in February 2001 and, since this time, have been committed to building a practice that focuses on providing high quality and compassionate care for it\'s patients and a welcoming and accessible environment for their human friends.\n\nOur Veterinary staff have a combined working experience of over 100 years in small animal general practice, enabling us to offer sound and sensible advice. We also pride ourselves on the fact that, if your pet is sick or injured, we are never \"Fully Booked\" : if we are open, your animal will be seen.\n\nWe are situated easily accessible to Eagle Junction, Hendra, Clayfield, Ascot, Hamilton and any of the inner Northern suburbs.', 'null', 'info@clayfieldvet.com.au', '(07) 3262 1988', '07 3262 1988', 'Clayfield ', '743 Sandgate Road', '4011', 'QLD', 36, '-27.418209', '153.056184', NULL, 'http://www.clayfieldvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/Clayfield-Veterinary-Clinic-188204397899499\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:30\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:30\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:30\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"13:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(83, 'Chatswood Vetfriends', 'Vetfriends Chatswood is a purpose built clinic ? built in 2005. We are a tight knit team consisting or vets and nurses who care about the patients as their own. Our main focus is to improve your pets? quality of life by providing the premium standard of care with latest knowledge and equipment whilst keeping the owners as educated as possible about their pets? health. We like to ensure that the experience at our clinic is as pleasant as possible for both clients and their pets by having the separate consult rooms for dogs and cats and using pheromone diffusers to help with pet anxiety. We are also in the middle of preparing our clinic to become a Cat Friendly Clinic (approved by ISFM, International Society or Feline Medicine) which would in turn help to ensure that our feline patients are as relaxed as possible at our clinic. We are also one of the few veterinary clinics in lower North Shore area which provide short-term boarding for dogs and we have full facility for cat boarding. We have designated parking area just underneath the clinic. We have several staff members with bilingual skills ? can speak Korean, Japanese, Cantonese and Mandarin. We also have close relationship with the 24-hour emergency specialist hospital in Crows Nest for complicated cases or cases needing overnight care.', 'null', 'chatswood1@vetfriends.com.au', '(02) 9882 3433', 'null', 'Chatswood', 'Cnr Smith & High Street ', '2067', 'NSW', 36, '-33.787147', '151.196722', NULL, 'http://www.vetfriends.com.au/chatswood-veterinary-hospital', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/ChatswoodVetfriends\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thurs