(84, 'Coastal Veterinary &amp; Pet Care Centre', 'We would like to welcome you to our Clinic and Thank you for letting us be involved in the care of your furry family members. We are made up of TWO Veterinary Clinics that have been treating animals since 1992 in the Mandurah area. The clinics are well equipped and dedicated to giving your family pet the highest quality service in a wide range of areas. We look forward to getting to know you and your pets over the years ahead.\n\nOur clinics are a General practice and mainly treat small animals such as Dogs, Cats, Rabbits, Guinea Pigs, Ferrets and Birds.\n\nOur Services include:\n\nGeneral Consultations\nVaccinations\nDe-sexing\nMicrochipping\nIn House Diagnostic Laboratory\nUltrasounds & Specialist Ultrasounds\nRadiology\nSoft Tissue Surgery\nOrthopaedic Surgery\nPrescription Diets & Quality Pet food', 'null', 'info@coastalvet.com.au', '08 9535 4255', '(08) 9412 5700', 'Mandurah', '268 Pinjarra Rd', '6210', 'WA', 36, '-32.535113', '115.733391', NULL, 'http://coastalvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/CoastalVeterinaryClinic\\/\"}', '{\"monday-from\":\"08:30\",\"monday-to\":\"18:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:30\",\"tuesday-to\":\"18:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:30\",\"wednesday-to\":\"18:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:30\",\"thursday-to\":\"18:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:30\",\"friday-to\":\"18:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"16:30\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
