(91, 'Ashgrove Ave Veterinary Clinic', 'Ashgrove Avenue Veterinary Clinic provides a comprehensive range of medical and surgical services for small animals in a friendly, caring environment. All of your pet\'s health care needs are catered for including vaccinations, heartworm prevention, nail trims, microchipping, ear cleaning, dental care, x-rays, blood analysis, routine and non routine surgeries including\nde-sexing and more. A full range of flea, tick and intestinal worm prevention products are available for purchase and we stock a wide variety of premium pet foods for both general and specific nutritional requirements.\n\nWe also have a professional groomer on site from monday to friday, a hydrobath service available on weekends and hold regular Puppy Preschool classes.\n\nOur friendly, professional staff are happy to assist you with any queries you may have regarding your pet\'s health care.', 'null', 'info@ashgrovevet.com.au', '(07) 3366 6666', 'null', 'Ashgrove ', '32 Ashgrove Avenue', '4060', 'QLD', 36, '-27.443175', '152.994156', NULL, 'http://www.ashgrovevet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/ashgrovevet\\/\"}', '{\"monday-from\":\"07:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"07:00\",\"saturday-to\":\"16:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"09:00\",\"sunday-to\":\"12:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
