(94, 'Angle Vale Veterinary Clinic', 'Kevin and his team of veterinarians, nurses and support staff are dedicated to providing exceptional service and veterinary medicine to families and their pets in Angle Vale and the surrounding areas.\n\nVets4Pets understand you love your pet, so a senior vet of your choice will organise the management and treatment of your animal companion for as long as you remain our client.', 'null', 'admin@vets4pets.com.au', '(08) 8284 7711', '08 8289 3722?', 'Angle Vale', '84 Angle Vale Road', '5117', 'SA', 36, '-34.640723', '138.646632', NULL, 'http://www.vets4pets.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/vets4petssa\\/\"}', '{\"monday-from\":\"09:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"09:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"09:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"09:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"09:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(95, 'Allison Crescent Veterinarian Hospital', 'Our Veterinary Hospital provides modern, professional and affordable health care for your pets. We aim to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff and leading veterinarians are all passionate about pets and avid animal lovers.\n\nAt our Veterinary Hospital, you?ll be fully supported with sound advice first and foremost. We know that  helping our clients starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you?ll be well equipped to make the best ongoing health care decisions for your pet.\n\nWith fully equipped examination rooms, diagnostic machines and pharmaceutical stores we provide on-the-spot assistance for nearly all pet health and medical needs. Take a moment to meet our team and our own pets. We look forward to seeing you and your pet again at the next scheduled visit.\n\nA big part of our local community\nOur Veterinary Hospital has been an integral part of our local community for years. In that time, we?ve helped thousands of our clients cats & dogs, rabbits & guinea pigs, birds, horses and even a few snakes. Being so strongly integrated with our local community is important to us and our clients. Our customers know by experience that they can rely on us for sound advice and treatment options and that their pet is in the very best hands with our team.', 'null', 'mail@allisoncrescentvet.com.au', '02 9543 5843', '9522 7088', 'Menai', 'Shop 13, Menai Metro, 72-80 Allison Crescent', '2234', 'NSW', 36, '-34.011943', '151.017364', NULL, 'http://www.allisoncrescentvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/allisoncrescentveterinaryhospital\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",