(96, 'Alexandria Veterinary Hospital', 'Open 7 days a week, Alexandria Vet Hospital is located at 138 Botany Road, Alexandria. Parking is located at the rear on Botany Lane.\n\nFrom Vaccination, behavioural issues and puppy classes to the latest techniques in theatre surgery, dental treatment, imaging and emergency care.\n\nAsk us about laparoscopic keyhole desexing and non-surgical video scoping.\n\nOur experienced team of Vets and Nurses prides itself on its close connections with the pet communities of Alexandria, Zetland, Redfern, Rosebery, Newtown, Waterloo and Erskineville.', 'null', 'info@alexandriavet.com.au', '(02) 9698 4120', '02 9197 5800', 'Alexandria ', 'Shop 1/138-142 Botany Rd', '2015', 'NSW', 36, '-33.899152', '151.197822', NULL, 'https://alexandriavet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/alexandriavet\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"20:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"20:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"20:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"20:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"20:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"15:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"13:00\",\"sunday-to\":\"17:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
