(99, 'AdelaideVet Goodwood Road', 'Adelaide Animal Hospitals has a new look\nAs of October 2016 we are adopting the new name of AdelaideVet to simplify and unify our group, reflecting the close alignment of our different locations.\n\n ? AdelaideVet - Trinity Gardens (formerly Adelaide Animal Hospital)\n\n? AdelaideVet - Prospect (formerly Prospect Road Veterinary Hospital)\n\n? AdelaideVet - Goodwood Road (formerly Goodwood Road Veterinary Clinic)\n\n? AdelaideVet - Stirling (formerly Adelaide Hills Animal Hospital)\n\nWe are the same familiar staff, buildings and facilities and we still have the same passion for looking after your pets as our family.', 'null', 'info@adelaidevet.com.au', '08 8169 9755', '8169 9777', 'Cumberland Park', '446 Goodwood Road', '5041', 'SA', 36, '-34.973122', '138.591061', NULL, 'https://adelaidevet.com.au/about/locations/adelaidevet-goodwood-road', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/adelaidevet\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"16:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
