(100, 'Aberfoyle Hub Veterinary Clinic', 'At the Aberfoyle Hub Veterinary Clinic, we are committed to caring for our clients and the pets which are entrusted to us... because they?re family!\n\nWe believe that the best pet health outcome is achieved via informed, collaborative and mutually respectful relationships between animal, owner and pet care professional. Our personalised service, using skilled and caring professionals, focuses on both you and your pet?s needs. \n\nWe provide you with:\n\nConsultations averaging 20 minutes, so you don?t feel rushed and can fully understand the proceedings.\n\nFollow up phone calls to check that things are going ok with your pet and to answer any on going questions.\n\nA caring attitude, because we know that your pets are much loved family members.\n\nReasonable professional fees to give you great value.\n\nFaces that you can get to know and trust because we have a happy work environment and loyal staff you can count on to care for both you and your pets.\n\nProducts that we recommend, that help nurture the animal?s health and well being in the family environment such as: premium and prescription pet foods, treats, pet accessories, toys and more.\nWe run on an appointment system for both consultations and surgery. Payments are required at the time of service or discharge. ', 'null', 'reception@hubvet.com.au', '(08) 8270 5155', 'null', 'Aberfoyle Park', 'Suite, 5 Hub Professional Centre', '5159', 'SA', 36, '-35.074852', '138.591343', NULL, 'http://hubvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/hubvets\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"18:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"18:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"18:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"18:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"18:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(101, 'Brighton Vet', 'Our dedicated team is always here for your pets\n\nBrighton Vet provides modern, professional and affordable health care for your pets. We aim to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff and leading veterinarians are all passionate about pets and avid animal lovers.\n\nAt Brighton Vet, you?ll be fully supported with sound advice first and foremost. We know that  helping our clients starts with providing a good understanding of health care issues and treatment options. With good advice and professional recommendations, you?ll be well equipped to make the best ongoing health care decisions for your pet.\n\nWith fully equipped examination rooms, diagnostic machines and pharmaceutical stores we provide on-the-spot assistance for nearly all pet health and medical needs. Take a moment to meet our team and our own pets. We look forward to seeing you and your pet again at the next scheduled visit.\n\nA big part of our local community\n\nBrighton Vet has been an integral part of our local community for years. In that time, we?ve helped thousands of our clients cats & dogs, rabbits & guinea pigs, birds and even a few snakes. Being so strongly integrated with our local community is important to us and our clients. Our customers know by experience that they can rely on us for sound advice and treatment options and that their pet is in the very best hands with our team.', 'null', 'vets@brightonvet.net.au', '(08) 9562 5555', '(08) 9562 5555', 'Butler', 'Shop 20A/5 Kingsbridge Boulevard', '6036', 'WA', 36, '-31.649063', '115.696963', NULL, 'http://www.brightonvet.net.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/Brighton-Vet-155305221158196\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"18:30\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"18:30\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"18:30\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"18:30\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"18:30\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"10:00\",\"sunday-to\":\"11:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(102, 'Herriot House Veterinary Surgery', 'Herriot House Veterinary Surgery was formed in 1989 when Peter Lyons and Peter Noble began working from a heritage house on the corner of West and Herries Streets in Toowoomba. Their aim was to provide quality care to the pets of Toowoomba and surrounding areas whilst providing a pleasant environment for both clients and staff.\n\nThe original house was renovated within heritage guidelines by well-known Toowoomba builders Ivan Johnson and John Barron. We have ample parking space, four consultation rooms, separate cat and dog wards, an x-ray room, surgery prep-room, surgery and isolation wards.\n\nThe beautiful surgery gardens have also been well tended, with several Carnival of Flowers awards as well as competition prizes for our giant Jacaranda tree and lovely Xanthorrhoea. We are also well known for our fragrant rose gardens and our roof displays that are set up at Christmas and Easter each year.\n\nQuality service and a well-equipped surgery has given Herriot House Veterinary Surgery a reputation for caring treatment that is second to none.\n\nWe are open from 7:00am to 7:00pm on weekdays, 7:30am to 6:00pm on Saturday and 9:00am to 5:30pm on Sunday. Contact us on (07) 4639 2012.\n\nIf you require a vet outside our regular business hours or want to request a house call, you can contact us on the same number.', 'null', 'mail@herriothousevets.com.au', '(07) 4639 1733', '07 4639 1733', 'Toowoomba City', 'Cnr of 143 West and Herries Sts', '4350', 'QLD', 36, '-27.563157', '151.94283', NULL, 'http://www.herriothousevets.com.au', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/HerriotHouseVets\\/\"}', '{\"monday-from\":\"07:00\",\"monday-to\":\"19:30\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"00:00\",\"tuesday-to\":\"00:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:00\",\"wednesday-to\":\"19:30\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:00\",\"thursday-to\":\"21:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:00\",\"friday-to\":\"19:30\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"07:30\",\"saturday-to\":\"18:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"08:30\",\"sunday-to\":\"17:30\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(103, 'Animal Health Centre', 'Experienced Vets In Lower Hutt\nAnimal Health Centre is a Veterinary Clinic and Animal Hospital located in Lower Hutt. We provide top quality veterinary care in Lower Hutt City, the Hutt Valley and surrounding areas. \n\nWe offer a full-service medical and surgical facility and comprehensive veterinary care to Lower Hutt\'s pets.\n\nFriendly Personal Service\nOur people are warm, personable and caring and we make a visit to the vet a positive experience. We get to know you and genuinely care about you and your pets.\n\nWe acknowledge that you are unique and we take time to find out who you are and what you need. We personalize our service to you by providing options that best fit your situation.\n\nUnderstanding Staff\nOur people all have pets so we understand the bond and concern when one of them is unwell. We do our best to help through clear explanations and providing options so you can choose the treatment plan that best suits your situation.\n\nExperienced Vets\nOur Veterinary Surgeons have each been qualified at least fifteen to twenty years, so you can rely on their extensive professional experience and expertise. Having more than one vet gives you choice and is also great when dealing with complex cases. If you like consistency we can also arrange for you to see the vet you prefer.\n\nDedicated Team\nOur people have a vested interest in providing quality personal service. We work on the philosophy that if you like what we do then you will come back, so we try to do the very best job we can for you and your fur family.\n\nPractice History\nAnimal Health Centre was opened by Dr Simon Nelson in February 2000.\n\nOur building was originally a Government Post Office which has been converted and modernized to meet the needs of a busy veterinary hospital.\n\nWe chose the location as being central and accessible, as well as having great parking for our clients.\n\nFrom a staff of two at the outset Animal Health Centre has grown to a team of nine today, including three vets, four vet nurses and our administration team.', 'null', 'info@lowerhuttvet.co.nz', '(04) 577 3717', '04 577 3717', 'Epuni, Lower Hutt ', '109 Oxford Terrace', '5011', 'NZ', 554, '-41.207163', '174.929619', NULL, 'https://lowerhuttvet.co.nz', NULL, '{\"monday-from\":\"08:00\",\"monday-to\":\"18:30\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"18:30\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"18:30\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"18:30\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"18:30\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(104, 'Canberra Equine Hospital', 'We hope the time you spend here with us is both enjoyable and educational, and that you gain as much practical equine veterinary work experience as possible. During this placement, you will be able to observe veterinary procedures and treatments, in hospital and out in the field consultations, surgeries, healthcare work-ups and radiographs. You will also help with daily patient care and chores throughout your stay, including feeding, watering, mucking out and cleaning.\n\nCanberra Equine Hospital is a veterinary hospital that is specialised for the needs of horses (predominantly) and other large livestock. We have four dedicated equine veterinarians who are knowledgeable and well practised in the large animal field, as well as committed veterinary nurses. Our facilities include a large surgery and recovery box, portable radiology, endoscope and ultrasound machine, breeding facilities, and a fully equipped on-site laboratory.', 'null', 'equine@canberravet.com.au', '(02) 6241 8888', '02 6241 8888', 'Lyneham', 'Federal Hwy & Barton Hwy', '2602', 'ACT', 36, '-35.238874', '149.137194', NULL, 'http://canberraequinehospital.com.au', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/CanberraEquineHospital\\/\"}', '{\"monday-from\":\"09:00\",\"monday-to\":\"17:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"09:00\",\"tuesday-to\":\"17:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"09:00\",\"wednesday-to\":\"17:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"09:00\",\"thursday-to\":\"17:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"09:00\",\"friday-to\":\"17:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":null,\"saturday-to\":null,\"saturday-from2\":null,\"saturday-to2\":null,\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(105, 'Canberra Veterinary Hospital', 'The Canberra Veterinary Hospital is one of only 32 Veterinary Hospitals in Australia to be recognised by the Australian Small Animal Veterinary Association (ASAVA) as an Accredited Veterinary Hospital of Excellence.\n\nWe have undertaken this process because we are serious about providing the highest standards of diagnostic, surgical, laboratory and nursing facilities achievable in our practice.\n\nWe want you and your pets to expect the best.\n\nThe Canberra Veterinary Hospital is also proud to be associated with the Canberra Equine Hospital.\n\nGet in touch on 02 6241 3333.', 'null', 'vets@canberravet.com.au', '(02) 6241 3333', 'null', 'Lyneham', 'Cnr Barton and Federal Highway', '2602', 'ACT', 36, '-35.239012', '149.136723', NULL, 'http://canberravet.com.au', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/canberravet\\/\"}', '{\"monday-from\":\"07:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:30\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:30\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:30\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"17:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"10:00\",\"sunday-to\":\"16:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(106, 'Inner South Veterinary Centre', 'Our Story\n\n*Caring for the people and pets of Canberra for over 16 years. \n*Great team of vets, nurses and staff who love caring for your pets\n*Dogs and cats, birds, reptiles, rabbits and guinea pigs, ferrets, rats and mice. \n*Our goal > happier and healthier pets living longer!\n*Plenty of parking right at the door. \n*Drop and go > drop off your pet on the way to work, and pick them up later. ', 'null', 'reception@innersouthvets.com.au', '1800 785 330', '02 6280 6344', 'Narrabundah ', '47 Jerrabomberra Ave', '2604', 'ACT', 36, '-35.338336', '149.151323', NULL, 'http://www.innersouthvets.com.au', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/Innersouthvets\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:30\",\"saturday-to\":\"16:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(107, 'Orewa Beach Vet Clinic', 'Cathy Holgate first opened the Orewa Beach Veterinary Clinic in 2002.  Matthew Gumbrell joined her in 2007.  Our clinic is built on the principle that the number one priority is always the animals. Their comfort and care is paramount, and our intention is to treat them with the same level of care that we would show our own pets.\n\nWe firmly believe that an animal that is comfortable and unstressed is not only easier to handle and treat, but is also in a better physiological state for healing and recovery.\n\nAmong some of the things that our clinic boasts are\n\n>sterile surgery suite for soft-tissue and orthopaedic surgeries\n>in-house testing for common tests (such as urinalysis and bacterial culture)\n>diagnostic xray and ultrasound facilities\n>air conditioning\n>separate (heated) hospital rooms for dogs and cats\n>partitioned waiting areas so nervous pets don?t have to sit beside other pets\n>active air extraction for areas that may have bad smells\n>separate isolation ward for patients with infectious diseases\n>blood pressure testing using doppler flow detector\n>dentistry equipment including ultrasonic descaling and polishing\n>wide range of high quality foods, including many therapeutic diets\n>wide range of pet care products and flea control products with sound advice given\nWe are proud to service our local community ? caring for pets in the Orewa, Silverdale, Stillwater, Millwater,\nRed Beach, Whangaparaoa, & adjoining rural areas.', 'null', 'obvc@xtra.co.nz', '09 426 9950', '09 443 5640', 'Orewa', '39 Florence Avenue', '931', 'NZ', 554, '-36.584433', '174.692609', NULL, 'http://www.orewabeachvetclinic.co.nz/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/OrewaBeachVetClinic\\/\"}', '{\"monday-from\":\"08:30\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:30\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:30\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:30\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:30\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(108, '4 Paws Vet', 'Proudly family owned and operated\nAt 4 Paws Vet in Neutral Bay we pride ourselves on professional pet care.\n\nWe are conveniently located on Military Road in the heart of Neutral Bay with FREE on-site parking at the rear of the hospital.\n\nThe experienced and friendly staff at 4 Paws Vet provide a personal and caring service for your pets. The Practice Principal, Dr Ian Russ, has been caring for pets on Sydney?s North Shore for more than 30 years. He heads a very experienced and helpful team of veterinarians and veterinary nurses.\n\n4 Paws Vet offers you a full range of veterinary diagnostic and treatment services to ensure the best possible care for your pet. The special services provided at 4 Paws Vet include a ?Kiss and Drop? service. This allows you to conveniently drop your pet for the day on your way to work while we take care of its needs at NO EXTRA COST. For your added convenience and your pet?s comfort we also do house calls. Our cat boarding facilities are modern and provide air-conditioned comfort for your precious moggy.\n\nWe are open seven days a week except for public holidays. Contact us now for an appointment.\n', 'null', 'vets@4pawsvet.com.au', '(02) 9953 1264', '02 9889 0289 ', 'Neutral Bay', '154 Military Road', '2089', 'NSW', 36, '-33.830321', '151.220936', NULL, 'http://www.4pawsvet.com.au/', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/4PawsVetClinic\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"16:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"10:00\",\"sunday-to\":\"13:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(109, 'Pets in the City', 'Our Salon\n\nThe cage free salon at Pets in the City is one of the most well established and highly regarded in Sydney. We are proud of the fact that people travel from all over Sydney (and beyond) to experience our superior service and a place that their dog loves visiting. Our staff really take the time to listen to your requests and groom your dog with great care. Our experienced stylists offer a full range of services for just about every breed of dog.Please see our grooming page for more information and our pricelist for our list of services and charges.\n\nVeterinary Care\n\nBeing attached to 4 Paws Veterinary Clinic,  Pets in the City is able to offer expert veterinary care and advice as well as on-site cat boarding. Did you know all dogs booked in for either a ?wash & tidy? or ?full service? are entitled to a FREE dental health check and weight/diet assessment from our neighbours at 4 Paws Veterinary Clinic? 4 Paws Vet is also happy to oblige with any other veterinary services you may require while your dog is with us for grooming. Just ask us at check-in!\n\nOur boutique\n\nPets in the City has everything the most decked out dog or kitted out kitty could ever need. Whether you want unique designer accessories or just need hardworking, everyday basics, we?ve got it covered.  We keep a gorgeous range of gifts for animal lovers, breed specific soft toys, books, jewellery, cards and much, much more.', 'null', 'info@petsinthecity.com.au', '(02) 9953 7387', 'null', 'Neutral Bay', '1/154 Military Rd', '2089', 'NSW', 36, '-33.830701', '151.220788', NULL, 'http://www.petsinthecity.com.au', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/petsinthecity4paws\\/\"}', '{\"monday-from\":\"09:00\",\"monday-to\":\"17:30\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"09:00\",\"tuesday-to\":\"17:30\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"09:00\",\"wednesday-to\":\"17:30\",\"wednesday-fro