(114, 'Caring Vets', 'Caring Vets was established in August 2006 by Dr Michael Wallace. Michael?s goal was to provide the Macarthur area with a friendly and professional vet care practice.\n\nWe are a predominantly small animal practice. Most of our patients are dogs, cats, rabbits and ferrets.\n\nCaring Vets have an up-to-date, fully equipped surgery. It is situated at 261 Camden Valley Way, Narellan, NSW, with ample off street parking. We are conveniently located within an easy drive from Narellan, Camden, Appin, Harrington Park, Oran Park, Currans Hill, Mount Annan, Elderslie, Gregory Hills and surrounds.\n\nCaring Vets are open 6 days a week for normal consultations. We are also available for Emergencies and Housecalls. If you require our Housecall service, please contact us to discuss.\n\n', 'null', 'info@caringvets.com.au', '(02) 4647 6321', 'null', 'Narellan ', '261 Camden Valley Way', '2567', 'NSW', 36, '-34.041623', '150.729654', NULL, 'http://caringvets.com.au', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/Caring-Vets-143715069004654\\/\"}', '{\"monday-from\":\"09:00\",\"monday-to\":\"19:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"09:00\",\"tuesday-to\":\"19:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"09:00\",\"wednesday-to\":\"19:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"09:00\",\"thursday-to\":\"19:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"09:00\",\"friday-to\":\"19:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"09:00\",\"saturday-to\":\"12:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":null,\"sunday-to\":null,\"sunday-from2\":null,\"sunday-to2\":null}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(115, 'Toowoomba Veterinary Hospital', 'Toowoomba Veterinary Hospital has been providing quality veterinary care for the animals of Toowoomba for over 60 years and from our current site since 1998.\n\nWe believe pets are an important part of your family, and treat each animal we see as part of our own extended family.', 'null', 'mail@toowoombavet.com.au', '(07) 4632 8333', '07 4632 8333', 'Toowoomba City', '191 Hume Street', '4350', 'QLD', 36, '-27.56648', '151.956284', NULL, 'www.toowoombavet.com.au', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/toowoombavethospital\\/\"}', '{\"monday-from\":\"08:00\",\"monday-to\":\"18:00\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"08:00\",\"tuesday-to\":\"18:00\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"08:00\",\"wednesday-to\":\"18:00\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"08:00\",\"thursday-to\":\"18:00\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"08:00\",\"friday-to\":\"18:00\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:00\",\"saturday-to\":\"15:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"09:00\",\"sunday-to\":\"16:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(116, 'Flemington Veterinary Hospital', 'Welcome to Flemington Veterinary Hospital\nFlemington Veterinary Clinic was purchased by Dr Anne Dynon in June 1989.\n\nThen a small clinic it provided health care for mainly dogs and cats. In 1995 the clinic was extensively renovated to become a purpose built veterinary centre. At this stage, a grooming service was introduced, employing a qualified groomer.\n\nIn 2002 the adjacent building was purchased and the second major renovation took place allowing us to upgrade the facilities to Hosptial Grade: extending consulting rooms, waiting rooms, car parking and introducing  our luxurious boutique cat hotel.  The Practice continues to grow and undergo evolution to provide advanced, quality, veterinary care.\n\nType of Practice\nFlemington Veterinary Hospital is a privately owned veterinary hospital located in Ascot Vale, Victoria.\n\nWe provide caring, quality veterinary advice, medicine, surgery and boarding for companion animals. Our hospital facilities are very similar to human hospitals including pathology facilities, an in house laboratory, an x ray suite, advanced anaesthetic monitoring and patient warming device in our surgical suite, ECG, and automatic intravenous fluid pumps for hospitalised animals. We have two visiting professional interest practitioners, allowing ultrasounds, endoscopy, oncology services and dermatology services to be performed in house and providing advice on more complex cases.\n\nThis allows us to provide a wide range of services from standard desexing to complex diagnostic investigations, advanced surgery or intensive medical care.\n\nFor more unusual cases we can refer to other specialists.\n\nWe are committed to delivering professional service and to assist you and your pets with the respect, kindness, level of care and expertise we would expect ourselves.\n\nPractice Ideal\nWe care for your pet as it was our own family member. \nWe attain to the highest ideals in patient care and customer service. \nWe strive to provide excellence in veterinary care, you can be assured of!', 'null', 'care@flemingtonvet.com.au', '(03) 9376 5299', 'null', 'Ascot Vale', '187 Mt Alexander Rd', '3032', 'VIC', 36, '-37.780455', '144.931923', NULL, 'www.flemingtonvet.com.au', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/flemingtonvet\\/\"}', '{\"monday-from\":\"07:00\",\"monday-to\":\"19:30\",\"monday-from2\":\"00:00\",\"monday-to2\":\"00:00\",\"tuesday-from\":\"07:00\",\"tuesday-to\":\"19:30\",\"tuesday-from2\":\"00:00\",\"tuesday-to2\":\"00:00\",\"wednesday-from\":\"07:00\",\"wednesday-to\":\"19:30\",\"wednesday-from2\":\"00:00\",\"wednesday-to2\":\"00:00\",\"thursday-from\":\"07:00\",\"thursday-to\":\"19:30\",\"thursday-from2\":\"00:00\",\"thursday-to2\":\"00:00\",\"friday-from\":\"07:00\",\"friday-to\":\"19:30\",\"friday-from2\":\"00:00\",\"friday-to2\":\"00:00\",\"saturday-from\":\"08:30\",\"saturday-to\":\"15:00\",\"saturday-from2\":\"00:00\",\"saturday-to2\":\"00:00\",\"sunday-from\":\"10:00\",\"sunday-to\":\"13:00\",\"sunday-from2\":\"00:00\",\"sunday-to2\":\"00:00\"}', 1, 1, 1, 1, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
